import React from "react";
import StudentOption from "./StudentOption";
import RouteButton from "./RouteButton";

export default class TASelectPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      studentOptions: [{ name: "John Dunaske" }, { name: "John Tantillo" }],
    };
  }

  componentDidMount = () => {
    console.log("gottem");
    //TODO: get the registered students
  }

  render() {
    return (
      <div className="pageContainer">
        <RouteButton active={true} text={"Back"} route={"/"} buttonType={"backButton"}/>
        <div className="selectContainer">
          {this.state.studentOptions.map((student) => {
            return (<StudentOption key={student.name} name={student.name}/>);
          })}
        </div>
      </div>
    );
  }
}
